if mibBuilder.loadTexts: nmsifthTemplateEntry.setDescription('An entry describing the general properties of a threshold template. The template is created using the nmsifthTemplateRowStatus object. Prior to creating an entry in the table, the manager should obtain a unique value of nmsifthTemplateIndex by reading the nmsifthTemplateIndexNext object. The values of nmsifthTemplateName and nmsifthTemplateNotifyHoldDownType must be provided before activating the entry. After creating an entry, thresholds can be defined for the template by creating entries with the same value of nmsifthTemplateIndex in the nmsifthThresholdTable. The template can then be assigned to one or more interfaces using the nmsifthTemplateIfAssignTable. Once an entry has been activated, the value of nmsifthTemplateName cannot be modified. In order to use a new value of nmsifthTemplateName, a new template must be defined. The values of nmsifthTemplateNotifyHoldDownType and nmsifthTemplateNotifyHoldDownTime may be modified when the entry is active. See the description clause of nmsifthTemplateNotifyHoldDownType for further caveats on modification of that object.')
