if mibBuilder.loadTexts: nmsifthTemplateName.setDescription("This object specifies a unique name associated with the threshold template by the management client, and provides a non-volatile 'handle' for the template. The name must not include whitespace characters. After this value has been written to the startup configuration, the agent must retain the value until a management client deletes it. The level of retention must span reboots and re-initializations of the agent, including those that result in different assignments to the value of nmsifthTemplateIndex associated with this template. Once an entry has been activated, this value cannot be modified. In order to use a new value of nmsifthTemplateName, a new template must be defined.")
nmsifthTemplateNotifyHoldDownType = MibTableColumn((1, 3, 6, 1, 4, 1, 11606, 10, 9, 218, 1, 1, 3, 1, 3), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("other", 1), ("holdDownTimer", 2), ("fireAndClearThresholds", 3)))).setMaxAccess("readcreate")
if mibBuilder.loadTexts: nmsifthTemplateNotifyHoldDownType.setStatus('current')
if mibBuilder.loadTexts: nmsifthTemplateNotifyHoldDownType.setDescription("This object specifies the method used to prevent an excess of notifications from being generated when operation fluctuates around a threshold level. The value 'holdDownTimer' indicates that notifications for a given threshold and interface are suppressed for a short amount of time after each notification. The time value is specified in nmsifthTemplateNotifyHoldDownTime, which is instantiated only when this object is set to 'holdDownTimer'. After a notification is received for a given threshold and interface, the next notification for that threshold and interface will be generated after at least nmsifthTemplateNotifyHoldDownTime amount of time has passed, only when the threshold is next fired or cleared. The value 'fireAndClearThresholds' indicates that hysteresis is used. The management client configures two values for each threshold: one for asserting that the threshold has been exceeded (see nmsifthThresholdFiredValue), and a second value for asserting that the threshold is no longer being exceeded (see nmsifthThresholdClearedValue, which is instantiated only when this object is set to 'fireAndClearThresholds'). When this entry in nmsifthTemplateTable is active, this object may only be modified if there are no active entries in nmsifthThresholdTable with the same value of nmsifthTemplateIndex.")
