if mibBuilder.loadTexts: nmsifthTemplateNotifyHoldDownTime.setDescription("The minimum amount of time between successive nmsifthIfThresholdFired or nmsifthIfThresholdCleared notifications for a given interface and template. This object is instantiated only when nmsifthTemplateNotifyHoldDownType is set to 'holdDownTimer'.")
