if mibBuilder.loadTexts: nmsifthThresholdEntry.setDescription("An entry specifying an interface threshold used in a threshold template. The entry is created using the nmsifthThresholdRowStatus object. The values of nmsifthThresholdObject, nmsifthThresholdSeverity, nmsifthThresholdType, and nmsifthThresholdFiredValue must be provided before activating the entry. If the value of nmsifthTemplateNotifyHoldDownType in the nmsifthTemplateEntry with the same value of nmsifthTemplateIndex is 'fireAndClearThresholds', then the value of nmsifthThresholdClearedValue must also be provided before activating the entry. If the value of nmsifthThresholdType is other than 'rateOfIncreaseExponentXIfSpeed', then the value of nmsifthThresholdSampleInterval must also be provided before activating the entry. The agent should not allow creation of two entries in the table with the same values of nmsifthTemplateIndex, nmsifthThresholdObject, nmsifthThresholdSeverity, and nmsifthThresholdDirection. Once an entry has been activated, the values of nmsifthThresholdObject, nmsifthThresholdSeverity, nmsifthThresholdType, and nmsifthThresholdDirection cannot be modified. In order to use new values of these objects, a new threshold must be defined. The values of nmsifthThresholdDescr, nmsifthThresholdFiredValue, nmsifthThresholdClearedValue, nmsifthThresholdSampleInterval, and nmsifthThresholdApsSwitchover may be modified when the entry is active.")
