if mibBuilder.loadTexts: nmsifthThresholdType.setStatus('current')
if mibBuilder.loadTexts: nmsifthThresholdType.setDescription("The manner in which to compare nmsifthThresholdObject to nmsifthThresholdFiredValue and nmsifthThresholdClearedValue. The value 'absoluteValue' indicates that the value of nmsifthThresholdObject is to be compared directly to nmsifthThresholdFiredValue or nmsifthThresholdClearedValue. The value 'deltaValue' indicates that the difference between two successive samples of nmsifthThresholdObject is to be compared to nmsifthThresholdFiredValue or nmsifthThresholdClearedValue. The polling interval between successive samples is defined in nmsifthThresholdSampleInterval. The value 'rateOfIncreaseExponentXIfSpeed' indicates that the rate of increase of nmsifthThresholdObject is to be compared to the negated value of nmsifthThresholdFiredValue used as the exponent of 10, times the value of ifSpeed (if the value of ifSpeed is less than the maximum value) or ifHighSpeed (otherwise). For example, a value of nmsifthThresholdFiredValue of 5 on a gigabit ethernet interface indicates a threshold of 10^-5 times the interface speed, which is equal to 10,000 per second. When the value of this object is 'rateOfIncreaseExponentXIfSpeed', the polling interval between successive samples is determined automatically by the agent. When the object identified by nmsifthThresholdObject is a counter, a threshold type of 'deltaValue' or 'rateOfIncreaseExponentXIfSpeed' should be used. When the object identified by nmsifthThresholdObject is not a counter, a threshold type of 'absoluteValue' should be used.")
nmsifthThresholdDirection = MibTableColumn((1, 3, 6, 1, 4, 1, 11606, 10, 9, 218, 1, 1, 5, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("rising", 1), ("falling", 2))).clone('rising')).setMaxAccess("readcreate")
if mibBuilder.loadTexts: nmsifthThresholdDirection.setStatus('current')
if mibBuilder.loadTexts: nmsifthThresholdDirection.setDescription("This object indicates which direction of movement causes the threshold to fire. The value 'rising' indicates that the threshold is fired when the current sampled value is numerically greater than or equal to the value of nmsifthThresholdFiredValue, and the threshold was considered to be cleared at the last sampling interval. If the value of the corresponding nmsifthTemplateNotifyHoldDownType object is 'fireAndClearThresholds', the threshold is cleared when the current sampled value is less than the value of nmsifthThresholdClearedValue, and the threshold was considered to be fired at the last sampling interval. If the value of the corresponding nmsifthTemplateNotifyHoldDownType object is other than 'fireAndClearThresholds', the threshold is cleared when the current sampled value is less than the value of nmsifthThresholdFiredValue, and the threshold was considered to be fired at the last sampling interval. The value 'falling' indicates that the threshold is fired when the current sampled value is numerically less than or equal to the value of nmsifthThresholdFiredValue, and the threshold was considered to be cleared at the last sampling interval. If the value of the corresponding nmsifthTemplateNotifyHoldDownType object is 'fireAndClearThresholds', the threshold is cleared when the current sampled value is greater than the value of nmsifthThresholdClearedValue, and the threshold was considered to be fired at the last sampling interval. If the value of the corresponding nmsifthTemplateNotifyHoldDownType object is other than 'fireAndClearThresholds', the threshold is cleared when the current sampled value is greater than the value of nmsifthThresholdFiredValue, and the threshold was considered to be fired at the last sampling interval.")
nmsifthThresholdFiredValue = MibTableColumn((1, 3, 6, 1, 4, 1, 11606, 10, 9, 218, 1, 1, 5, 1, 7), Integer32().subtype(subtypeSpec=ValueRangeConstraint(-2147483648, 2147483647))).setMaxAccess("readcreate")
if mibBuilder.loadTexts: nmsifthThresholdFiredValue.setStatus('current')
if mibBuilder.loadTexts: nmsifthThresholdFiredValue.setDescription("A threshold value to check against the object identified in nmsifthThresholdObject. If the value of nmsifthThresholdDirection is 'rising', then the threshold is fired when the current sampled value (absolute, delta, or rate of increase, depending on the value of nmsifthThresholdType) of the object identified in nmsifthThresholdObject is greater than or equal to this value. If the value of nmsifthThresholdDirection is 'falling', then the threshold is fired when the current sampled value (absolute, delta, or rate of increase, depending on the value of nmsifthThresholdType) of the object identified in nmsifthThresholdObject is less than or equal to this value.")
nmsifthThresholdClearedValue = MibTableColumn((1, 3, 6, 1, 4, 1, 11606, 10, 9, 218, 1, 1, 5, 1, 8), Integer32().subtype(subtypeSpec=ValueRangeConstraint(-2147483648, 2147483647))).setMaxAccess("readcreate")
if mibBuilder.loadTexts: nmsifthThresholdClearedValue.setStatus('current')
if mibBuilder.loadTexts: nmsifthThresholdClearedValue.setDescription("A threshold value to check against the object identified in nmsifthThresholdObject. If the value of nmsifthThresholdDirection is 'rising', then the threshold is cleared when the current sampled value (absolute, delta, or rate of increase, depending on the value of nmsifthThresholdType) of the object identified in nmsifthThresholdObject is less than this value. If the value of nmsifthThresholdDirection is 'falling', then the threshold is cleared when the current sampled value (absolute, delta, or rate of increase, depending on the value of nmsifthThresholdType) of the object identified in nmsifthThresholdObject is greater than this value. This object is instantiated only when the value of nmsifthTemplateNotifyHoldDownType in the nmsifthTemplateEntry with the same value of nmsifthTemplateIndex is 'fireAndClearThresholds'.")
