if mibBuilder.loadTexts: nmsifthTemplateIfAssignOperStatus.setDescription("This object indicates whether the threshold template identified by nmsifthTemplateIndex is operational on the interface identified by nmsifthTemplateIfAssignInterface. When the value of this object is 'up', this indicates that the thresholds in this template (identified by nmsifthTemplateIndex) are activated on this interface, with the following exception: If a threshold is defined on an object that does not have an instance for this interface, then the threshold is not activated on this interface. If any of the thresholds are being exceeded, then a corresponding entry exists in the nmsifthIfThresholdFiredTable. When the value of this object is 'down', this indicates that all thresholds in the template are de-activated on this interface and there is no corresponding entry in the nmsifthIfThresholdFiredTable, regardless of whether any of the thresholds in the template are being exceeded on this interface. One reason for a template not to be operational on an interface to which it is assigned is when the interface has two (or more) templates assigned to it that contain thresholds on the same object with the same severity and direction, i.e., thresholds with the same values of nmsifthThresholdObject, nmsifthThresholdSeverity, and nmsifthThresholdDirection. This may occur when a template is assigned to the interface, or when a threshold is added to a template that is already active on the interface. When this occurs, the implementation may operate on both (or all) threshold values, or it may take down one (or more) of the templates on this interface, which is indicated by changing the value of this object from 'up' to 'down'.")
